import React, { useState } from 'react';
import styled from 'styled-components';
import backgroundImage from '../images/logo-5.svg'; // Mettez le bon chemin vers le SVG ici
import GrainEffect from './GrainEffect';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  width: 100vw;
  overflow: hidden;
  background-image: url(${backgroundImage});
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  position: relative; 
  z-index: 5;
`;

const Button = styled.button`
  display: flex;
  align-items: center;
  gap: 8px;
  padding: 10px 20px;
  background-color: white;
  border: 1px solid rgba(0, 0, 0, 0.12);
  border-radius: 12px;
  color: #000;
  font-family: 'Poppins', sans-serif;
  font-size: 14px;
  font-weight: 600;
  cursor: pointer;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  z-index: 5;

  &:hover {
    background-color: #fff5f5;
    color: #ff4500;
    border-color: #ff4500;
    box-shadow: 0 6px 12px rgba(255, 69, 0, 0.3);
  }
`;

const ButtonContainer = styled.div`
  position: absolute;
  bottom: 48px;
  display: flex;
  gap: 20px;
  margin-top: 20px;
`;

const Generator = () => {
  const [number, setNumber] = useState(1);

  const generateNumber = () => {
    const randomNumber = Math.floor(Math.random() * 500) + 1;
    setNumber(randomNumber);
  };

  return (
    <Container>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh', width: '100vw' }}>
        <div style={{ width: '40%', height: '630px', overflow: 'hidden', border: '1px solid #ccc', borderRadius: '16px' }}>
          <div style={{ transform: 'translateY(-120px)' }}>
            <iframe
              src={`https://sexpositions.club/positions/${number}.html`}
              title="Position Generator"
              style={{ width: '100%', height: '1000px', border: 'none', pointerEvents: 'none' }}
            />
          </div>
        </div>
      </div>
      <ButtonContainer>
        <Button onClick={generateNumber}>
          <span role="img" aria-label="Tour">ðŸ‘€</span> GÃ©nÃ©rer
        </Button>
      </ButtonContainer>
      <GrainEffect />
    </Container>
  );
};

export default Generator;
